import React from 'react';

const SpyTable = (props) => {
    const {spy} = props;

    return <table rules='none'>
        <thead>
            <tr>
                <td>Company</td>
                <td>Ticker</td>
                <td>Price</td>
                <td>Weight</td>
            </tr>
        </thead>
        <tbody>
            {spy.map((stock, i) => {
                return <tr key={i}>
                    <td></td>
                </tr>
            })
            
            }
        </tbody>
    </table>
}

export default SpyTable;
